window.bookSummaryJSON = "<p><b>There is one ruler, one judge, one king...and he's my grumpy new boss.</b></p> <p>Cash Bachman is a powerful man who gets what he wants. </p> <p>And he wants...<i>me</i>?</p> <p>I'm suddenly whisked away to his glamorous hidden world. </p> <p>He has me sign a contract making him my...<i>Dom.</i> </p> <p>I thought that kind of thing only happened in movies, but here I am. </p> <p>Shaking in my stilettos every time I step into his office. </p> <p>Cash has bosshole tendencies and I have to obey every command. </p> <p>Or risk facing humiliating punishments that leave me blushing for days. </p> <p>His love is harsh and leaves rosy marks on my skin. </p> <p>Despite my shame, I love every moment. </p> <p>When our contract runs out... </p> <p>He doesn't want to let me go. </p> <p><b>Could it be that he needs me as much as I need him?</b></p>"; 
